import { Route, Routes } from "react-router-dom";
import "./App.css";
import Navbar from "./components/Navebar/Navbar";

function App() {
  return (
    <div className="App">
      <Navbar />
    <Routes>
      <Route path="/" element={<Home/>}/>
    </Routes>
    </div>
  );
}

export default App;
